import React from 'react';
import LeftBar from './Components/Leftbar';
import MainKonten from './Components/MainKonten';

function App() {
  return (
    <body className='bg-black'>
      <div className='relative h-screen'>
        <div className='md:flex justify-center'>
        <header className=" text-white h-auto md:py-4">
          <LeftBar />
        </header>
        <main role='main'>
          <div class="md:flex md:w-[990px]">
            <section class="md:w-3/5 border border-y-0 border-gray-800 md:max-w-[600px]">
              <MainKonten />
            </section>
            <ul class="list-none">

            </ul>
          </div>
        </main>
        </div>
      </div>
    </body>
  );
}

export default App;
